import React from "react";
import { axios, swal } from "../../dependencies";
import "./NavBar.css";

function NavBar() {
	const menu = () => {
		axios({
			url: "/api/auth/me",
			method: "GET",
		})
			.then((res) => {
				if (res.data.success) {
					window.location = "/" + res.data.role + "/menu";
				} else {
					swal.fire({
						title: "Error!",
						text: res.data.error,
						icon: "warning",
						background: "black",
						color: "white",
					});
				}
			})
			.catch((err) => {
				console.log(err.response);
				swal.fire({
					title: "Error!",
					text: err.response.data.error,
					icon: "warning",
					background: "black",
					color: "white",
				});
			});
	};

	const profile = () => {
		window.location = "/profile";
	};

	const logout = () => {
		axios({
			url: "/api/auth/logout",
			method: "GET",
		})
			.then((res) => {
				if (res.data.success) {
					window.location = "/";
				} else {
					swal.fire({
						title: "Error!",
						text: res.data.error,
						icon: "warning",
						background: "black",
						color: "white",
					});
				}
			})
			.catch((err) => {
				console.log(err.response);
				swal.fire({
					title: "Error!",
					text: err.response.data.error,
					icon: "warning",
					background: "black",
					color: "white",
				});
			});
	};

	return (
		<nav class="Navbar">
			<div class="navbar-logo" onClick={menu}>
				Turing Master
			</div>
			<div id="background"></div>
			<ul class="navMenu">
				<li class="nav-item" key="1">
					<button
						class="nav-link"
						aria-details="Profile details"
						onClick={profile}
					>
						Profile
					</button>
				</li>
				<li class="nav-item" key="2">
					<button
						class="nav-link"
						aria-details="Logout your account"
						onClick={logout}
					>
						Logout
					</button>
				</li>
			</ul>
		</nav>
	);
}

export default NavBar;
